import './App.css';
import { Routes, Route } from 'react-router-dom'
import MedicineView from './views/MedicineView';
import MedInfo from './views/MedInfo';



function App() {
  return (
    <Routes>
      <Route path='/' element={<MedicineView />} />
      <Route path='/medInfo/:id' element={<MedInfo />} />
    </Routes>
  );
}

export default App;
